import React, { useState, useEffect } from "react";
import axios from "axios";
//import Table from
import { SelectColumnFilter } from "./Filter" 


function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios("http://cms.swiftnav.com/decoupler/translate-path?path=/resource-library")
    .then((res) => {
      setData(res.data);
    })
    .catch((err) => console.log(err))
  }, []);

  const columns = [
    {
      Header: "Title",
      accessor: "title", 
      Filter: SelectColumnFilter,
      filter: "includes",
    },
    {
      Header: "Version", 
      accessor: "release_version",
      Filter: SelectColumnFilter,
      filter: "includes",
    },
    {
      Header: "Release Date",
      accessor: "release_date",
      Filter: SelectColumnFilter,
      filter: "includes",
    },
    {
      Header: "Product",
      accessor: "related_product",
      Filter: SelectColumnFilter,
      filter: "includes",
    },
    {
      Header: "Catagory", 
      accessor: "asset_type", 
      Filter: SelectColumnFilter,
      filter: "includes",
    },
    {
      Header: "File",
      accessor: "filename", 
      Cell: (row) => 
      <a href={row.row.original.uri}>{row.row.original.filename}</a>,
    },
    {
      Header: "VersionType",
      accessor: "version_type", 
      Filter: SelectColumnFilter,
      filter: "includes",
    },
    {
      Header: "Size",
      accessor: "filesize",
    },
  ];

  return (
    <div className="App">

    </div>
  );
}

export default App;
